__NUXT_JSONP__("/family-of-hein-daanen", (function(a,b,c,d,e,f,g,h,i){return {data:[{document:{slug:"family-of-hein-daanen",description:"",title:"Family of Hein Daanen",position:9,category:"Personal",_template:"page",toc:[],body:{type:"root",children:[{type:b,tag:e,props:{},children:[{type:a,value:"Hein Daanen is married to Elly Rentes and has 2 children."}]},{type:a,value:g},{type:b,tag:e,props:{},children:[{type:a,value:"As a hobby Hein started to make an inventory of the family members, helped by several others. Now a database is constructed of over 2000 family members."},{type:b,tag:c,props:{},children:[]},{type:a,value:"\nThe Daanen family is available on this website: "},{type:b,tag:h,props:{href:"https:\u002F\u002Fheindaanen.nl\u002Fimages\u002Fdaanen.pdf",rel:["nofollow","noopener","noreferrer"],target:"_blank",title:i},children:[{type:a,value:i}]},{type:a,value:". "},{type:b,tag:d,props:{},children:[{type:a,value:"Andr√© van Eck"}]},{type:a,value:" is acknowledged for his contribution. The Daanen family comes from Beuningen in the province of Gelderland."},{type:b,tag:c,props:{},children:[]},{type:a,value:"\nThe mother of Hein is Joke "},{type:b,tag:f,props:{},children:[{type:a,value:"Savelkouls"}]},{type:a,value:". Thanks to "},{type:b,tag:d,props:{},children:[{type:a,value:"Frans Savelkouls"}]},{type:a,value:" in Oisterwijk, almost 1000 family members of the Savelkouls family are to my disposal. The roots are in Limburg, in the South of The Netherlands."},{type:b,tag:c,props:{},children:[]},{type:a,value:"\nThe father of Elly, "},{type:b,tag:d,props:{},children:[{type:a,value:"Henk Rentes"}]},{type:a,value:", took care for the data of the "},{type:b,tag:f,props:{},children:[{type:a,value:"Rentes"}]},{type:a,value:" family, originating from Friesland in Northern Netherlands."},{type:b,tag:c,props:{},children:[]},{type:a,value:"\nThe family of the mother of Elly, Bep "},{type:b,tag:f,props:{},children:[{type:a,value:"Maat"}]},{type:a,value:" is also available in detail, thanks to "},{type:b,tag:d,props:{},children:[{type:a,value:"Betty Maat"}]},{type:a,value:". The Maat family and the family Van der Plas (grandma of Elly) originate from Katwijk a\u002Fd Zee, a fishermans town at the West coast."}]},{type:a,value:g},{type:b,tag:e,props:{},children:[{type:a,value:"Additional data on the Daanen family are greatly appreciated. Please contact "},{type:b,tag:h,props:{href:"mailto:daanen@ziggo.nl"},children:[{type:a,value:"Hein Daanen"}]},{type:a,value:" for any additional information."}]}]},dir:"\u002Fen",path:"\u002Fen\u002Ffamily-of-hein-daanen",extension:".md",createdAt:"2023-04-01T15:45:26.195Z",updatedAt:"2023-04-01T16:00:09.125Z",to:"\u002Ffamily-of-hein-daanen"},prev:{title:"Media",path:"\u002Fen\u002Fmedia",to:"\u002Fmedia"},next:{title:"Hobbies",path:"\u002Fen\u002Fhobbies",to:"\u002Fhobbies"}}],fetch:{},mutations:[]}}("text","element","br","em","p","strong","\n","a","daanen.pdf")));